allowedMimeTypes:
  - application/json
  - application/x-www-form-urlencoded
  - application/octet-stream
globalReservedIdentifiers:
  - "break"
  - "case"
  - "catch"
  - "class"
  - "const"
  - "continue"
  - "debugger"
  - "default"
  - "delete"
  - "do"
  - "else"
  - "enum"
  - "export"
  - "exports"
  - "extends"
  - "false"
  - "finally"
  - "for"
  - "function"
  - "if"
  - "import"
  - "in"
  - "instanceof"
  - "new"
  - "null"
  - "return"
  - "super"
  - "switch"
  - "this"
  - "throw"
  - "true"
  - "try"
  - "typeof"
  - "var"
  - "void"
  - "while"
  - "with"
  - "as"
  - "implements"
  - "interface"
  - "let"
  - "package"
  - "private"
  - "protected"
  - "public"
  - "static"
  - "yield"
  - "any"
  - "boolean"
  - "constructor"
  - "declare"
  - "get"
  - "module"
  - "require"
  - "number"
  - "set"
  - "string"
  - "symbol"
  - "type"
  - "from"
  - "of"
  - "Record"
  - "Array"
  - "Error"
  # The following are reserved for @principlestudios/openapi-codegen-typescript
  - HttpHeaders
  - HttpQuery
  - throwIfNullOrUndefined
  - encodeURI
  - RequestConversions
  - RequestOpts
  - ResponseArgs
  - StandardResponse
  # The following are reserved for operation mapping
  - RequestParams
  - RequestBodies
  - Responses
  - responseConversion
  - index
contextualReservedIdentifiers: {}
mapType: Record<string, {}>
arrayType: Array<{}>
fallbackType: any
types:
  boolean:
    default: boolean
  string:
    formats:
      #byte: byte[]
      binary: Blob
    default: string
  number:
    default: number
  integer:
    formats:
      int64: BigInt
      uint64: BigInt
    default: number
  object:
    formats:
      any: any
